import toast from 'react-hot-toast';

/**Validate Log in Page  */
export async function logInValidate2(values){
    const error = logInVerify({}, values);

    return error;
}



/** LogIn Validation */
function logInVerify(error={}, values) {
    if(!values.otp){
        error = toast.error("OTP Required..... !")
    }else if(values.otp.length < 4){
        error = toast.error("OTP had more than 4 letter/number....!")
    }

    return error;
}
